import * as React from 'react';
import styles from './SadTrombone.module.scss';
import { ISadTromboneProps } from './ISadTromboneProps';
import { escape } from '@microsoft/sp-lodash-subset';

export default class SadTrombone extends React.Component<ISadTromboneProps, {}> {
  public render(): React.ReactElement<ISadTromboneProps> {
    return (
      <div className={ styles.sadTrombone }>
        
        <button id="SadTrombone" className={ styles.button } type="submit" onClick={this.SadTrombone} >{this.props.description}</button>
     
      </div>
    );
  }

  SadTrombone()
  {         
    var player = document.createElement('audio');
    player.src = 'data:audio/mp3;base64,';
    player.play();  
  }
}
